import React, { Component } from "react";
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      count: 1
    }
  }

  render() {
    return (
      <div className="App">
        <h1>Count: {this.state.count}</h1>
        <button>+</button>
        <button>-</button>
      </div>
    );
  }
}

export default App;
